actionConfiguration.body:
mutable => {
  const configs = appsmith.store.mutableConfigs;
  const idx = configs.findIndex(config => config.databaseName === mutable.databaseName);
  if (idx >= 0) {
    configs[idx] = {
      ...configs[idx],
      ...mutable
    };
    storeValue('mutableConfigs', configs, false);
  }
}

